import React, { useState } from "react";
import Navbar from "../../Components/navbar/Navbar";
import Footer from "../../Components/common/Footer";
import "./bus_ticket_css/bus_ticket.css";

const BusTicket: React.FC<{ setCurrentPage: (page: string) => void }> = ({ setCurrentPage }) => {
  const [from, setFrom] = useState("");
  const [to, setTo] = useState("");
  const [date, setDate] = useState("");

  const trips = [
    { id: 1, route: "Hà Nội → Hồ Chí Minh", price: "500,000 VND", seats: "Còn 10 chỗ" },
    { id: 2, route: "Hà Nội → Đà Nẵng", price: "350,000 VND", seats: "Còn 5 chỗ" },
    { id: 3, route: "Hà Nội → Đà Lạt", price: "450,000 VND", seats: "Còn 8 chỗ" },
  ];

  const handleSearch = () => {
    alert(`Tìm vé từ ${from} đến ${to} vào ngày ${date}`);
    // Thêm logic tìm kiếm vé ở đây
  };

  return (
    <div className="bus-ticket-page">
      <Navbar setCurrentPage={setCurrentPage} />
      <header className="bus-ticket-header">
        <h1>Mua vé xe bus</h1>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Nơi đi"
            value={from}
            onChange={(e) => setFrom(e.target.value)}
          />
          <input
            type="text"
            placeholder="Nơi đến"
            value={to}
            onChange={(e) => setTo(e.target.value)}
          />
          <input
            type="date"
            placeholder="Ngày khởi hành"
            value={date}
            onChange={(e) => setDate(e.target.value)}
          />
          <button onClick={handleSearch}>Tìm vé</button>
        </div>
      </header>
      <section className="bus-ticket-list">
        <h2>Danh sách vé xe bus</h2>
        <div className="ticket-cards">
          {trips.map((trip) => (
            <div key={trip.id} className="ticket-card">
              <p>
                <strong>{trip.route}</strong>
              </p>
              <p>Giá vé: {trip.price}</p>
              <p>{trip.seats}</p>
              <button>Mua vé</button>
            </div>
          ))}
        </div>
      </section>
      <Footer year={2025} companyName="Ticket Car" />
    </div>
  );
};

export default BusTicket;
